<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>WosCosplay</title>
    <style>
        body {
            background-color: black;
            z-index: 1
        }

        #center {
            position: absolute;
            z-index: 2;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
        }

        #myd2 {
            position: relative;
        }

        #formdiv {
            width: 450px;
        }

        .img {
            position: absolute;
            top: 80px;
            left: -50px;
        }

        input[type="text"] {
            width: 300px;
            padding: 10px;
            border: 2px solid #4CAF50;
            border-radius: 5px;
            font-size: 16px;
            transition: border-color 0.3s;
        }

        input[type="text"]:focus {
            border-color: #f44336;
        }

        .white-button {
            position: fixed;
            z-index: 2;
            top: 20px;
            left: 20px;
            background-color: darkgray;
            border: none;
            border-radius: 20px;
            color: black;
            padding: 5px 10px;
            text-align: center;
            text-decoration: none;
            display: inline-block;
            font-size: 12px;
            margin: 2px 1px;
            cursor: pointer;
        }

        .btn-gradient {
            display: inline-block;

            padding: 12px 20px;
            font-size: 16px;
            color: #fff;
            background: linear-gradient(45deg, #6a11cb 0%, #2575fc 100%);
            border: none;
            border-radius: 25px;
            cursor: pointer;
            transition: background 0.3s ease;
        }

        .btn-gradient:hover {
            background: linear-gradient(45deg, #2575fc 0%, #6a11cb 100%);
        }

        #canvadiv {
            position: relative;
            top: -20px;
        }


        

        @media (max-width: 768px) {
            #myd2 {
                position: relative;
                top: 30px;
                left: 20px;
            }

            .img {
                position: absolute;
                left: 0px;
            }

            #canvadiv {
                left: -310px;
            }
        }




        
        @media (max-width: 450px) {
            #myd2 {
                position: relative;
                top: 30px;
                left: 10px;
            }

            .img {
                position: absolute;
                left: 30px;
            }

            #canvadiv {
                left: -330px;
            }

            #formdiv {
                position: relative;
                left: 50px;
            }

            input[type="text"] {
                width: 200px;
            }
        }

        dialog {
            position: absolute;
            z-index: 3;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            width: 300px;
            padding: 20px;
            background-color: #f9f9f9;
            border: 1px solid #ccc;
            border-radius: 5px;
            box-shadow: 1px 1px 5px rgba(0, 0, 0, 0.5);
        }

        .close-button {
            float: right;
            cursor: pointer;
        }

    </style>
    <script src="https://telegram.org/js/telegram-web-app.js"></script>
    <embed id="music" src="music3.mp3" width=0 height=0 loop="true" autostart="true"></embed>
</head>
<body>
<div id="canvadiv">
    <canvas id="myCanvas" width="800" height="500"></canvas>
</div>
    
<div id="center">
    <div id="myd2">
        <div id="formdiv">
            <form name="input" method="get">
                <input type="text" id="password" name="name">
                <button id="button" class="btn-gradient" type="button" onclick="go()">我想出去</button>
            </form>
        </div>
        <div class="img">
            <img src="mathpicture2.png">
        </div>
    </div>
</div>
<button id="button2" class="white-button" type="button" onclick="_0x222739()">先去練練手</button>
<dialog id="my-dialog">
    <span class="close-button" id="close-dialog">&times;</span>

    <p>你的Telegram版本過舊，請更新版本。</p>
</dialog>
<dialog id="my-dialog2">
    <span class="close-button" id="close-dialog2">&times;</span>

    <p>服務繁忙，請稍後再試。</p>
</dialog>
